import { Container, Gradient } from './HomeElements';
import Background from '../../Images/home-background.png';
import { Link } from 'react-router-dom';

const Home = () => {
    return (
        <Container image={Background}>
            <Gradient>
                <span style={{color: 'white'}}>Julian van Beek</span><br />
                <span style={{color: 'white'}}>Web Designer</span>

                <div style={{color: 'white'}}><span>|</span> Creative <span>|</span>
                Tech-savvy <span>|</span>
                Passionated <span>|</span>
                Eager to learn <span>|</span>
                Customer oriented <span>|</span>
                Result driven <span>|</span></div>

                <Link to='/portfolio'>View Projects</Link>
            </Gradient>
        </Container>
    );
}

export default Home;
